script: |
  super -f text -I q116.spq | sort > q116.out

inputs:
  - name: q116.spq
    data: |
      SELECT DISTINCT COUNT ( - col0 ) - + 16 FROM tab0 (FORMAT parquet) cor0 WHERE col1 NOT BETWEEN + CAST ( - ( - - 61 ) AS REAL ) AND 39;
  - name: tab0

outputs:
  - name: q116.out
    data: |
      -15
